import { Container, Link } from "@mui/material";

export default function HomePage(){
  navigate = useNavigate();

  const navigateToLink = (event, link) => {
    event.preventDefault()
    navigate(link);
  }
  return(
    <>
    <Container>
      <Link onClick={(event) => navigateToLink(event, "/home")}> Home</Link>
      <Link>/Crypto</Link>
    </Container>
    </>
  )
}
